  return (
    <div className={styles.row}>
      <div className={styles.col}>
        <h1>
          Give Your Workout <br />A New style!
        </h1>
        <p>
          Success isn't always about greatness . It's about consistency.
          Consistent
          <br /> hardwork gains success. Greatness will come.
        </p>
